import React from 'react'

const Header = () => {
  return (
    // 상단바 입니다.
    <header className='top'>
      {/* 상단바 좌측의 아이콘과 글씨입니다. */}
        <logo className='top_logo'>
            <i className='top_icon'>@</i>
            <a className='top_logo_text'>title</a>
        </logo>
        {/* 상바봐 우측의 nav와 로그인 입니다. */}
        <ul className='top_nav'>
            <li className='list_Style'><a>메뉴1</a></li>
            <li className='list_Style'><a>메뉴2</a></li>
            <li className='list_Style'><a>메뉴3</a></li>
            <li className='list_Style'><a>메뉴4</a></li>
            <li className='list_Style'><a className='nav_login_btn'>로그인</a></li>
        </ul>
    </header>
  )
}

export default Header
